import React from 'react';

import { Jumbotron, Button } from 'react-bootstrap';

import Footer from '../Footer';

import '../../App.css';


const Services = () => {
  return (
  	<>
  		<ServiceContent />
  		<Footer />
  	</>
  );
}

const ServiceContent = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<h1>SERVICES</h1>
				    <p>
				    	We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <span>contact</span> us to maek ararngements.
				    </p>

	  				<p>
	    				<Button variant="primary">Learn more</Button>
	  				</p>
				</Jumbotron>
			</div>
		</>
	)
}

export default Services;
